import React from 'react';
import { Link } from 'react-router-dom';
import '../css/Home.css';

function Home() {
  return (
    <div className="home-container">
      {/* Background with "DSA" */}
      <div className="dsa-background">
        <h1 className="dsa-bg-text">DSA</h1>
        <div className="dsa-overlay-text">
          <h2>Master the Art of Data Structures & Algorithms</h2>
          <p>Enhance your problem-solving skills and excel in coding interviews.</p>
        </div>
      </div>

      {/* The Process - 4 Steps */}
      <div className="process-section">
        <h3 className="process-heading">THE PROCESS</h3>
        <div className="steps-container">
          <div className="step-box">
            <h4>01</h4>
            <p>Understand the Basics.</p>
          </div>
          <div className="step-box">
            <h4>02</h4>
            <p>Learn Key Algorithms.</p>
          </div>
          <div className="step-box">
            <h4>03</h4>
            <p>Practice Problem Solving.</p>
          </div>
          <div className="step-box">
            <h4>04</h4>
            <p>Optimize & Master DSA.</p>
          </div>
        </div>
        {/* Explore Button */}
        <Link to="/Latest-Blogs" className="explore-btn">EXPLORE</Link>
      </div>
    </div>
  );
}

export default Home;
